import React from "react";
import KanjiData from "./kanjidata.js";

const Kanji_Card = () => {
    const KData = KanjiData;
    console.log(KData);
    return (
        <>
            <div>
                {KanjiData.map((data, key) => {
                    return (
                        <div key={key}>
                            {data.id}
                            {data.words}
                        </div>
                    )
                })}
            </div>
        </>
    ) 
}

export default Kanji_Card;
